mapper.select:

select 

from jvd_kyosoba_shussobetsu1
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}

mapper.delete:

delete from jvd_kyosoba_shussobetsu1
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
